INSERT INTO `college_info` VALUES (1, '北京大学', '北京市海淀区颐和园路5号', '北京大学创办于1898年，初名京师大学堂，是中国第一所国立综合性大学，也是当时中国最高教育行政机关。辛亥革命后，于1912年改为现名。 作为新文化运动的中心和五四运动的策源地，作为中国最早传播马克思主义和民主科学思想的发祥地，作为中国共产党最早的活动基地，北京大学为民族的振兴和解放、国家的建设和发展、社会的文明和进步做出了不可替代的贡献，在中国走向现代化的进程中起到了重要的先锋作用。爱国、进步、民主、科学的传统精神和勤奋、严谨、求实、创新的学风在这里生生不息、代代相传。', 'http://www.gx211.com/UploadFile/FCKUpload/12(1).jpg', '2020-05-16 07:49:55', '2020-05-16 07:50:00');
INSERT INTO `college_info` VALUES (2, '清华大学', '北京市海淀区', '清华大学的前身清华学堂始建于1911年，1912年更名为清华学校。1928年更名为国立清华大学。1937年抗日战争全面爆发后南迁长沙，与北京大学、南开大学组建国立长沙临时大学，1938年迁至昆明改名为国立西南联合大学。1946年迁回清华园，设有文、法、理、工、农等5个学院、26个系。 　　1952年全国高等学校院系调整后，清华大学成为一所多科性工业大学，重点为国家培养工程技术人才，被誉为红色工程师的摇篮。改革开放以来，清华大学逐步确立了建设世界一流大学的长远目标，进入了蓬勃发展的新时期。', 'http://www.gx211.com/UploadFile/FCKUpload/qinghudaxuexiaohui.jpg', '2020-05-16 07:52:05', '2020-05-16 07:52:09');
INSERT INTO `college_info` VALUES (3, '复旦大学', '上海市邯郸路220号', '复旦大学校名取自《尚书大传》之日月光华，旦复旦兮，始创于1905年，原名复旦公学，1917年定名为复旦大学，是中国人自主创办的第一所高等院校。上海医科大学前身是1927年创办的国立第四中山大学医学院。2000年，复旦大学与上海医科大学合并。目前，学校拥有哲学、经济学、法学、教育学、文学、历史学、理学、工学、医学、管理学、艺术学等11个学科门类；2017年，学校入选双一流建设高校名单，确立了27个双一流建设学科，是一所世界知名、国内顶尖的综合性研究型大学。', 'http://www.gx211.com/UploadFile/FCKUpload/20095.jpg', '2020-05-16 07:54:12', '2020-05-16 07:54:16');
INSERT INTO `college_info` VALUES (4, '上海交通大学', '上海市闵行区东川路800号', '上海交通大学是我国历史最悠久、享誉海内外的著名高等学府之一，是教育部直属并与上海市共建的全国重点大学。经过120多年的不懈努力，上海交通大学已经成为一所“综合性、研究型、国际化”的国内一流、国际知名大学。上海交通大学深厚的文化底蕴，悠久的办学传统，奋发图强的发展历程，特别改革开放以来取得的巨大成就，为国内外所瞩目。这所英才辈出的百年学府正乘风扬帆，以传承文明、探求真理为使命，以振兴中华、造福人类为己任，向着中国特色世界一流大学目标奋进', 'http://www.gx211.com/UploadFile/FCKUpload/shanghaijiaotongdaxuexiaohui.jpg', '2020-05-16 07:56:41', '2020-05-16 07:56:44');
INSERT INTO `college_info` VALUES (5, '浙江大学', '浙江省杭州市浙江大学紫金港', '浙江大学是一所历史悠久、声誉卓著的高等学府，坐落于中国历史文化名城、风景旅游胜地杭州。浙江大学的前身求是书院创立于1897年，为中国人自己最早创办的新式高等学校之一。1928年，定名国立浙江大学。抗战期间，浙大举校西迁，在贵州遵义、湄潭等地办学七年，1946年秋回迁杭州。1952年全国高等学校院系调整时，浙江大学部分系科转入兄弟高校和中国科学院，留在杭州的主体部分被分为多所单科性院校，后分别发展为原浙江大学、杭州大学、浙江农业大学和浙江医科大学。', 'http://www.gx211.com/UploadFile/FCKUpload/zhejiangdaxuexiaohui.jpg', '2020-05-16 07:58:31', '2020-05-16 07:58:36');
INSERT INTO `college_info` VALUES (6, '宁波大学', '宁波市江北区风华路818号', '宁波大学是一所在改革开放中成长起来的新兴地方综合性大学，是国家双一流建设高校，浙江省、教育部、宁波市共建高校，国家海洋局与宁波市共建高校，浙江省重点建设高校。1986年由世界船王包玉刚先生捐资创立，邓小平同志题写校名。建校之初，由北京大学、复旦大学、浙江大学、中国科学技术大学、原杭州大学五校对口援建，高起点地开始了办学历程。', 'http://www.gx211.com/UploadFile/FCKUpload/ningbodaxuexiaohui.jpg', '2020-05-16 07:59:52', '2020-05-16 07:59:56');
INSERT INTO `college_info` VALUES (7, '杭州电子科技大学', '杭州市杭州经济技术开发区白杨街道2号大街1号  ', '杭州电子科技大学（Hangzhou Dianzi University），简称“杭电”，位于杭州市，是浙江省人民政府与国防科技工业局共建的教学研究型大学，是浙江省首批重点建设的5所高校之一，是省属高校中唯一拥有国防特色重点专业的高校，入选国家“111计划”、教育部“卓越工程师教育培养计划”、“国家级大学生创新创业训练计划”、“国家级新工科研究与实践项目”、“国家级特色专业建设点”、“全国毕业生就业典型经验高校”、“浙江省首批文化校园建设试点单位”，是博士学位授予单位，具有硕士推免权和全球雅思考点。', 'https://bkimg.cdn.bcebos.com/pic/7aec54e736d12f2e307562024fc2d56285356864?x-bce-process=image/resize,m_lfit,w_268,limit_1/format,f_jpg', '2020-05-16 08:03:01', '2020-05-16 08:03:05');
INSERT INTO `college_info` VALUES (8, '杭州电子科技大学信息工程学院', '杭州临安杭电路1号', '杭州电子科技大学信息工程学院（Hangzhou Dianzi University Information Engineering School），简称杭电信工，地处杭州市临安区 [1]  ，是1999年经浙江省人民政府批准，由杭州电子科技大学、浙江青山湖科研创新基地投资有限公司、杭州文一教育发展有限公司合作举办；2004年由教育部确认的独立学院。\r\n截止2016年1月，开设27个专业，面向11个省、区招生，全日制在校本科生8400多人，毕业颁发杭州电子科技大学信息工程学院毕业证书，符合学士学位授予条件的，颁发杭州电子科技大学信息工程学院学士学位证书。\r\n学院地处杭州城西科创大走廊的的青山湖畔，学院占地面积500亩，建筑面积17万平方米。学院设有12个系部、27个专业, 涵盖了工学、经济学、管理学、文学、艺术学五大学科门类，形成了计算机类、机械自动化类、电子信息类、经济管理类、艺术设计类、英语类六大本科专业群布局结构。截止2020年5月，学院在校全日制本科生8856人。', 'https://bkimg.cdn.bcebos.com/pic/0bd162d9f2d3572c687f36bd8513632762d0c336?x-bce-process=image/resize,m_lfit,w_268,limit_1/format,f_jpg', '2020-05-16 08:04:53', '2020-05-16 08:04:57');
