INSERT INTO `topic_info` VALUES (2, 1, '无穷级数', '一起来看看无穷级数吧，无穷级数被认为是微积分一个不可缺少的部分', '&emsp;&emsp;无穷级数是高等数学的一个重要组成部分，它是表示函数研究函数的性质以及进行数值计算的一种工具。本章先讨论常数项级数,介绍无穷级数的一些基本内容，然后讨论函数项级数，着重讨论如何将函数展开成幂级数和三角级数的问题。\r\n常数项级数的概念<br>\r\n人们认识事物在数量方面的特性，往往有一个由近似到精确的过程在这种认识过程中，会遇到由有限个数量相加到无穷多个数量相加的问题，它比较与微元法相似。<br>\r\n&emsp;&emsp;一般地，如果给定一个数列<br>\r\n&emsp;&emsp;A1,A2,A3,A4,A5,~~~~An,~~<br>\r\n&emsp;&emsp;那么由这数列构成的表达式<br>\r\n&emsp;&emsp;A1+A2+A3+~~~~~+An+~~~<br>\r\n&emsp;&emsp;叫做(常数项)无究级数,简称(常数项)级数,记为求和,即其中第n项An,叫做级数的一般项。<br>\r\n上述级数的定义只是一个形式上的定义，怎样理解无穷级数中无穷多个数量相加呢?联系上面关于计算圆面积的例子,我们可以从有限项的和出发,观察它们的变化趋势,由此来理解无穷多个数量相加的含义作(常数项)级数(1-1)的前n项的和\r\n定义如果级数和的部分和数列{s}有极限,即Sn<br>\r\n&emsp;&emsp;那么称无穷级数∑u,收敛,这时极限叫做这级数的和<br>\r\n&emsp;&emsp;如果部分和没有极限,那么称无穷级数An 发散<br>\r\n&emsp;&emsp;显然,当级数收敛时,其部分和s。是级数的和s的近似值,它们之间的差值叫做级数的余项用近似值s代替和s所产生的误差是这个余项的绝对值,即误差。<br>\r\n&emsp;&emsp;收敛级数的基本性质<br>\r\n&emsp;&emsp;根据无穷级数收敛发散以及和的概念,可以得出收敛级数的几个基本性质<br>\r\n&emsp;&emsp;性质1；如果级数收敛于和，那么级数的k倍也收敛且其和为k倍的和。<br>\r\n&emsp;&emsp;性质2；如果级数Un与Uv分别收敛于和s与o,那么级数UN+Uv也收敛，且其和为s+o<br>\r\n&emsp;&emsp;它符合一般的运算规律。通常简单的微分性质它都拥有。<br>', NULL, 'http://123.57.57.136/jklimage/hu4.jpg', '2020-06-02 19:18:08', '2020-06-02 19:18:11');
INSERT INTO `topic_info` VALUES (5, 2, '推荐一部好片', '这是一部划时代的电影，电影的魅力就在于永远都能带来震撼', '&emsp;&emsp;上一部中，超级电脑“天网”阻止人类抵抗领袖约翰·康纳诞生的行动失败，时隔13年后，在“审判日”到来之前，“天网”派出了更加先进的生化机器人T-1000（罗伯特·帕特里克 饰）从公元2029年回到洛杉矶追杀已经长大的约翰，与此同时，约翰也派出了机器人T-800（阿诺· 施瓦辛格 饰）回去保护年幼的自己。<br>\r\n&emsp;&emsp;此时，萨拉·康纳（琳达·汉密尔顿 饰）因为怪异的言行而住进了精神疗养院，约翰则和养父母住在一起，行为叛逆。T-800找到他们，在逃避T-1000追杀过程中，获得了二人的信任。<br>\r\n&emsp;&emsp;为了改变未来的历史，挽救人类的命运，萨拉、约翰和T-800 Model 101找到了“天网”之父，迈尔斯·戴森（乔·莫顿 饰），说服他销毁一切有关“天网”的资料，此时，警察和T-1000同时赶来，他们陷入了多方争斗中。<br>', NULL, 'http://123.57.57.136/jklimage/hu11.jpg', '2020-06-02 19:20:52', '2020-06-02 19:20:56');
INSERT INTO `topic_info` VALUES (6, 3, '四六级学习方法', '今天你学英语了吗，四六级其实并不难，方法最重要', '1单词<br><br>\r\n&emsp;&emsp;首先当然还是词汇量的掌握了，看见有很多同学回去买四六级的核心单词书背，然后许多免费课程上的老师会说这些书的单词第一个一般都是abandon ，的确是这样的，如果让我拿着一本书每天背单词的话我可能都做不到。所以我觉得单词还是在于平时的积累，推荐大家用一个百词斩的软件，当然还有许多软件扇贝单词等等，我个人比较喜欢百词斩的背单词方式。不知道大家是否跟我一样，因为我们学校的课程比较少所以一般时间我都是手机不离手的，所以我一般都在手机上背单词，想背单词的时候打开随时就可以背几个，也可以设置计划，一天背25个或是多少个都可以。然后我再考四级的时候之前我背的是百词斩里的四级核心词汇，每天背30个，只有1000多个词，恰好能够在2016年12月份的那次考试前背完，其实整体看我的词汇量并不多然而更重要的是另一个主要的单词来自于真题。<br><br>\r\n2总结性刷真题<br><br>\r\n&emsp;&emsp;一般准备四六级的最重要的就是刷真题的过程，我觉得如果想要自己考试四六级成功的话还是要学会刷真题。就我个人的学习经验来看，我认为做题不应该只是把他的每道题做出来然后对一下答案是否正确，最重要的还是我们做每道题把总结出的经验记在旁边，就拿比较蒙但分值很少的15选10来说，最初看到这道题的时候我真的毫无头绪，不过后来我发现这种题最重要的就是单词的积累，而对于自己来说单词的积累还好并不难，更多的时候我们的准备时间可能不是很充分也许只有两个月或是三个月，所以对于单词的积累我们可能做不到很多，所以我更推荐大家在这短暂的时间内背一些有用的单词四六级的高频词汇。还有真题中阅读中常出现的时候要记得整理下来，整理好这些之后每天刷单词，可以不单是要刷手机上的高频词汇还要刷真题当中阅读和15选10常出现的词汇这其中包括一些常见的词组也都要整理出来。我不知道大家都习惯用什么练习册我个人用的是星火的四级和六级我就只买了这一本，然后刷明白真题仔细研究其中的套路，做好做完每一套试卷的总结，真的差不多就可以过了。真心感觉阅读就是四六级最完整的突破口，词汇量最重要。当然还有一些答题顺序我认为比较好的先不推荐了，如有疑问咱们再聊哦。<br>', NULL, 'http://123.57.57.136/jklimage/hu12.jpg', '2020-06-02 19:22:09', '2020-06-02 19:22:13');
INSERT INTO `topic_info` VALUES (7, 4, '什么是有氧运动', '你知道什么是有氧运动吗？一起来看看吧', '&emsp;&emsp;有氧运动是指人体在氧气充分供应的情况下进行的体育锻炼。即在运动过程中，人体吸入的氧气与需求相等，达到生理上的平衡状态。<br>\r\n&emsp;&emsp;简单来说，有氧运动是指强度低且富韵律性的运动，其运动时间较长（约30分钟或以上），运动强度在中等或中上的程度（最大心率值的60%至80%）。<br>\r\n&emsp;&emsp;是不是“有氧运动”，衡量的标准是心率。心率保持在150次/分钟的运动量为有氧运动，因为此时血液可以供给心肌足够的氧气；因此，它的特点是强度低、有节奏、持续时间较长。要求每次锻炼的时间不少于30分钟，每周坚持3到5次。这种锻炼，氧气能充分燃烧（即氧化）体内的糖分，还可消耗体内脂肪，增强和改善心肺功能，预防骨质疏松，调节心理和精神状态，是健身的主要运动方式。所以说，如果体重超标，要想通过运动来达到减肥的目的，建议选择有氧运动，像慢跑、骑自行车。<br>', NULL, 'http://123.57.57.136/jklimage/hu16.jpg', '2020-06-05 13:08:32', '2020-06-05 13:08:34');
